private static boolean keyEq(Object src, Object dest) {
    return src.equals(dest);
}

void setTable(HashEntry<K, V>[] newTable) {
    threshold = (int) (newTable.length * loadFactor);
    table = newTable;
    refQueue = new ReferenceQueue<Object>();
}

HashEntry<K, V> getFirst(int hash) {
    HashEntry<K, V>[] tab = table;
    return tab[hash & tab.length - 1];
}

HashEntry<K, V> newHashEntry(
        K key, int hash, HashEntry<K, V> next, V value) {
    return new HashEntry<K, V>(
            key, hash, next, value, refQueue);
}

V readValueUnderLock(HashEntry<K, V> e) {
    lock();
    try {
        removeStale();
        return e.value();
    } finally {
        unlock();
    }
}

V get(Object key, int hash) {
    if (count != 0) { // read-volatile
        HashEntry<K, V> e = getFirst(hash);
        while (e != null) {
            if (e.hash == hash && keyEq(key, e.key())) {
                Object opaque = e.valueRef;
                if (opaque != null) {
                    return e.dereferenceValue(opaque);
                }

                return readValueUnderLock(e); // recheck
            }
            e = e.next;
        }
    }
    return null;
}

boolean containsKey(Object key, int hash) {
    if (count != 0) { // read-volatile
        HashEntry<K, V> e = getFirst(hash);
        while (e != null) {
            if (e.hash == hash && keyEq(key, e.key())) {
                return true;
            }
            e = e.next;
        }
    }
    return false;
}

boolean containsValue(Object value) {
    if (count != 0) { // read-volatile
        for (HashEntry<K, V> e: table) {
            for (; e != null; e = e.next) {
                Object opaque = e.valueRef;
                V v;

                if (opaque == null) {
                    v = readValueUnderLock(e); // recheck
                } else {
                    v = e.dereferenceValue(opaque);
                }

                if (value.equals(v)) {
                    return true;
                }
            }
        }
    }
    return false;
}

boolean replace(K key, int hash, V oldValue, V newValue) {
    lock();
    try {
        removeStale();
        HashEntry<K, V> e = getFirst(hash);
        while (e != null && (e.hash != hash || !keyEq(key, e.key()))) {
            e = e.next;
        }

        boolean replaced = false;
        if (e != null && oldValue.equals(e.value())) {
            replaced = true;
            e.setValue(newValue);
        }
        return replaced;
    } finally {
        unlock();
    }
}

V replace(K key, int hash, V newValue) {
    lock();
    try {
        removeStale();
        HashEntry<K, V> e = getFirst(hash);
        while (e != null && (e.hash != hash || !keyEq(key, e.key()))) {
            e = e.next;
        }

        V oldValue = null;
        if (e != null) {
            oldValue = e.value();
            e.setValue(newValue);
        }
        return oldValue;
    } finally {
        unlock();
    }
}

V put(K key, int hash, V value, boolean onlyIfAbsent) {
    lock();
    try {
        removeStale();
        int c = count;
        if (c ++ > threshold) { // ensure capacity
            int reduced = rehash();
            if (reduced > 0) {
                count = (c -= reduced) - 1; // write-volatile
            }
        }

        HashEntry<K, V>[] tab = table;
        int index = hash & tab.length - 1;
        HashEntry<K, V> first = tab[index];
        HashEntry<K, V> e = first;
        while (e != null && (e.hash != hash || !keyEq(key, e.key()))) {
            e = e.next;
        }

        V oldValue;
        if (e != null) {
            oldValue = e.value();
            if (!onlyIfAbsent) {
                e.setValue(value);
            }
        } else {
            oldValue = null;
            ++ modCount;
            tab[index] = newHashEntry(key, hash, first, value);
            count = c; // write-volatile
        }
        return oldValue;
    } finally {
        unlock();
    }
}

int rehash() {
    HashEntry<K, V>[] oldTable = table;
    int oldCapacity = oldTable.length;
    if (oldCapacity >= MAXIMUM_CAPACITY) {
        return 0;
    }

    /*
     * Reclassify nodes in each list to new Map.  Because we are using
     * power-of-two expansion, the elements from each bin must either
     * stay at same index, or move with a power of two offset. We
     * eliminate unnecessary node creation by catching cases where old
     * nodes can be reused because their next fields won't change.
     * Statistically, at the default threshold, only about one-sixth of
     * them need cloning when a table doubles. The nodes they replace
     * will be garbage collectable as soon as they are no longer
     * referenced by any reader thread that may be in the midst of
     * traversing table right now.
     */

    HashEntry<K, V>[] newTable = HashEntry.newArray(oldCapacity << 1);
    threshold = (int) (newTable.length * loadFactor);
    int sizeMask = newTable.length - 1;
    int reduce = 0;
    for (HashEntry<K, V> e: oldTable) {
        // We need to guarantee that any existing reads of old Map can
        // proceed. So we cannot yet null out each bin.
        if (e != null) {
            HashEntry<K, V> next = e.next;
            int idx = e.hash & sizeMask;

            // Single node on list
            if (next == null) {
                newTable[idx] = e;
            } else {
                // Reuse trailing consecutive sequence at same slot
                HashEntry<K, V> lastRun = e;
                int lastIdx = idx;
                for (HashEntry<K, V> last = next; last != null; last = last.next) {
                    int k = last.hash & sizeMask;
                    if (k != lastIdx) {
                        lastIdx = k;
                        lastRun = last;
                    }
                }
                newTable[lastIdx] = lastRun;
                // Clone all remaining nodes
                for (HashEntry<K, V> p = e; p != lastRun; p = p.next) {
                    // Skip GC'd weak references
                    K key = p.key();
                    if (key == null) {
                        reduce++;
                        continue;
                    }
                    int k = p.hash & sizeMask;
                    HashEntry<K, V> n = newTable[k];
                    newTable[k] = newHashEntry(key, p.hash, n, p.value());
                }
            }
        }
    }
    table = newTable;
    return reduce;
}

V remove(Object key, int hash, Object value, boolean refRemove) {
    lock();
    try {
        if (!refRemove) {
            removeStale();
        }
        int c = count - 1;
        HashEntry<K, V>[] tab = table;
        int index = hash & tab.length - 1;
        HashEntry<K, V> first = tab[index];
        HashEntry<K, V> e = first;
        // a reference remove operation compares the Reference instance
        while (e != null && key != e.keyRef &&
                (refRemove || hash != e.hash || !keyEq(key, e.key()))) {
            e = e.next;
        }

        V oldValue = null;
        if (e != null) {
            V v = e.value();
            if (value == null || value.equals(v)) {
                oldValue = v;
                // All entries following removed node can stay in list,
                // but all preceding ones need to be cloned.
                ++ modCount;
                HashEntry<K, V> newFirst = e.next;
                for (HashEntry<K, V> p = first; p != e; p = p.next) {
                    K pKey = p.key();
                    if (pKey == null) { // Skip GC'd keys
                        c --;
                        continue;
                    }

                    newFirst = newHashEntry(
                            pKey, p.hash, newFirst, p.value());
                }
                tab[index] = newFirst;
                count = c; // write-volatile
            }
        }
        return oldValue;
    } finally {
        unlock();
    }
}

@SuppressWarnings("rawtypes")
void removeStale() {
    WeakKeyReference ref;
    while ((ref = (WeakKeyReference) refQueue.poll()) != null) {
        remove(ref.keyRef(), ref.keyHash(), null, true);
    }
}

void clear() {
    if (count != 0) {
        lock();
        try {
            Arrays.fill(table, null);
            ++ modCount;
            // replace the reference queue to avoid unnecessary stale
            // cleanups
            refQueue = new ReferenceQueue<Object>();
            count = 0; // write-volatile
        } finally {
            unlock();
        }
    }
}

@Override
public boolean isEmpty() {
    final Segment<K, V>[] segments = this.segments;
    /*
     * We keep track of per-segment modCounts to avoid ABA problems in which
     * an element in one segment was added and in another removed during
     * traversal, in which case the table was never actually empty at any
     * point. Note the similar use of modCounts in the size() and
     * containsValue() methods, which are the only other methods also
     * susceptible to ABA problems.
     */
    int[] mc = new int[segments.length];
    int mcsum = 0;
    for (int i = 0; i < segments.length; ++ i) {
        if (segments[i].count != 0) {
            return false;
        } else {
            mcsum += mc[i] = segments[i].modCount;
        }
    }
    // If mcsum happens to be zero, then we know we got a snapshot before
    // any modifications at all were made.  This is probably common enough
    // to bother tracking.
    if (mcsum != 0) {
        for (int i = 0; i < segments.length; ++ i) {
            if (segments[i].count != 0 || mc[i] != segments[i].modCount) {
                return false;
            }
        }
    }
    return true;
}

@Override
public int size() {
    final Segment<K, V>[] segments = this.segments;
    long sum = 0;
    long check = 0;
    int[] mc = new int[segments.length];
    // Try a few times to get accurate count. On failure due to continuous
    // async changes in table, resort to locking.
    for (int k = 0; k < RETRIES_BEFORE_LOCK; ++ k) {
        check = 0;
        sum = 0;
        int mcsum = 0;
        for (int i = 0; i < segments.length; ++ i) {
            sum += segments[i].count;
            mcsum += mc[i] = segments[i].modCount;
        }
        if (mcsum != 0) {
            for (int i = 0; i < segments.length; ++ i) {
                check += segments[i].count;
                if (mc[i] != segments[i].modCount) {
                    check = -1; // force retry
                    break;
                }
            }
        }
        if (check == sum) {
            break;
        }
    }
    if (check != sum) { // Resort to locking all segments
        sum = 0;
        for (Segment<K, V> segment: segments) {
            segment.lock();
        }
        for (Segment<K, V> segment: segments) {
            sum += segment.count;
        }
        for (Segment<K, V> segment: segments) {
            segment.unlock();
        }
    }
    if (sum > Integer.MAX_VALUE) {
        return Integer.MAX_VALUE;
    } else {
        return (int) sum;
    }
}

@Override
public V get(Object key) {
    int hash = hashOf(key);
    return segmentFor(hash).get(key, hash);
}

@Override
public boolean containsKey(Object key) {
    int hash = hashOf(key);
    return segmentFor(hash).containsKey(key, hash);
}

@Override
public boolean containsValue(Object value) {
    if (value == null) {
        throw new NullPointerException();
    }

    // See explanation of modCount use above

    final Segment<K, V>[] segments = this.segments;
    int[] mc = new int[segments.length];

    // Try a few times without locking
    for (int k = 0; k < RETRIES_BEFORE_LOCK; ++ k) {
        int mcsum = 0;
        for (int i = 0; i < segments.length; ++ i) {
            mcsum += mc[i] = segments[i].modCount;
            if (segments[i].containsValue(value)) {
                return true;
            }
        }
        boolean cleanSweep = true;
        if (mcsum != 0) {
            for (int i = 0; i < segments.length; ++ i) {
                if (mc[i] != segments[i].modCount) {
                    cleanSweep = false;
                    break;
                }
            }
        }
        if (cleanSweep) {
            return false;
        }
    }
    // Resort to locking all segments
    for (Segment<K, V> segment: segments) {
        segment.lock();
    }
    boolean found = false;
    try {
        for (Segment<K, V> segment: segments) {
            if (segment.containsValue(value)) {
                found = true;
                break;
            }
        }
    } finally {
        for (Segment<K, V> segment: segments) {
            segment.unlock();
        }
    }
    return found;
}

public boolean contains(Object value) {
    return containsValue(value);
}

@Override
public V put(K key, V value) {
    if (value == null) {
        throw new NullPointerException();
    }
    int hash = hashOf(key);
    return segmentFor(hash).put(key, hash, value, false);
}

public V putIfAbsent(K key, V value) {
    if (value == null) {
        throw new NullPointerException();
    }
    int hash = hashOf(key);
    return segmentFor(hash).put(key, hash, value, true);
}

@Override
public void putAll(Map<? extends K, ? extends V> m) {
    for (Map.Entry<? extends K, ? extends V> e: m.entrySet()) {
        put(e.getKey(), e.getValue());
    }
}

@Override
public V remove(Object key) {
    int hash = hashOf(key);
    return segmentFor(hash).remove(key, hash, null, false);
}

public boolean remove(Object key, Object value) {
    int hash = hashOf(key);
    if (value == null) {
        return false;
    }
    return segmentFor(hash).remove(key, hash, value, false) != null;
}

public boolean replace(K key, V oldValue, V newValue) {
    if (oldValue == null || newValue == null) {
        throw new NullPointerException();
    }
    int hash = hashOf(key);
    return segmentFor(hash).replace(key, hash, oldValue, newValue);
}

public V replace(K key, V value) {
    if (value == null) {
        throw new NullPointerException();
    }
    int hash = hashOf(key);
    return segmentFor(hash).replace(key, hash, value);
}

@Override
public void clear() {
    for (Segment<K, V> segment: segments) {
        segment.clear();
    }
}

public void purgeStaleEntries() {
    for (Segment<K, V> segment: segments) {
        segment.removeStale();
    }
}

