            long offset = UNSAFE.staticFieldOffset(implLookupField);
            IMPL_LOOKUP = (MethodHandles.Lookup) UNSAFE.getObject(UNSAFE.staticFieldBase(implLookupField), offset);
        } catch (Throwable e) {
            // ignored
        }
    }
    return IMPL_LOOKUP;
}

