    commandClassList.add(WatchCommand.class);
    commandClassList.add(TimeTunnelCommand.class);
    commandClassList.add(JvmCommand.class);
    commandClassList.add(MemoryCommand.class);
    commandClassList.add(PerfCounterCommand.class);
    // commandClassList.add(GroovyScriptCommand.class);
    commandClassList.add(OgnlCommand.class);
    commandClassList.add(MemoryCompilerCommand.class);
    commandClassList.add(RedefineCommand.class);
    commandClassList.add(RetransformCommand.class);
    commandClassList.add(DashboardCommand.class);
    commandClassList.add(DumpClassCommand.class);
    commandClassList.add(HeapDumpCommand.class);
    commandClassList.add(JulyCommand.class);
    commandClassList.add(ThanksCommand.class);
    commandClassList.add(OptionsCommand.class);
    commandClassList.add(ClsCommand.class);
    commandClassList.add(ResetCommand.class);
    commandClassList.add(VersionCommand.class);
    commandClassList.add(SessionCommand.class);
    commandClassList.add(SystemPropertyCommand.class);
    commandClassList.add(SystemEnvCommand.class);
    commandClassList.add(VMOptionCommand.class);
    commandClassList.add(LoggerCommand.class);
    commandClassList.add(HistoryCommand.class);
    commandClassList.add(CatCommand.class);
    commandClassList.add(Base64Command.class);
    commandClassList.add(EchoCommand.class);
    commandClassList.add(PwdCommand.class);
    commandClassList.add(MBeanCommand.class);
    commandClassList.add(GrepCommand.class);
    commandClassList.add(TeeCommand.class);
    commandClassList.add(ProfilerCommand.class);
    commandClassList.add(VmToolCommand.class);
    commandClassList.add(StopCommand.class);
    try {
        if (ClassLoader.getSystemClassLoader().getResource("jdk/jfr/Recording.class") != null) {
            commandClassList.add(JFRCommand.class);
        }
    } catch (Throwable e) {
        logger.error("This jdk version not support jfr command");
    }

    for (Class<? extends AnnotatedCommand> clazz : commandClassList) {
        Name name = clazz.getAnnotation(Name.class);
        if (name != null && name.value() != null) {
            if (disabledCommands.contains(name.value())) {
                continue;
            }
        }
        commands.add(Command.create(clazz));
    }
}

@Override
public void draw(CommandProcess process, RowAffectModel result) {
    process.write(result.affect() + "\n");
}

@Override
public void draw(CommandProcess process, ClassLoaderModel result) {
    if (result.getMatchedClassLoaders() != null) {
        process.write("Matched classloaders: \n");
        drawClassLoaders(process, result.getMatchedClassLoaders(), false);
        process.write("\n");
        return;
    }
    if (result.getClassSet() != null) {
        drawAllClasses(process, result.getClassSet());
    }
    if (result.getResources() != null) {
        drawResources(process, result.getResources());
    }
    if (result.getLoadClass() != null) {
        drawLoadClass(process, result.getLoadClass());
    }
    if (result.getUrls() != null) {
        drawClassLoaderUrls(process, result.getUrls());
    }
    if (result.getClassLoaders() != null){
        drawClassLoaders(process, result.getClassLoaders(), result.getTree());
    }
    if (result.getClassLoaderStats() != null){
        drawClassLoaderStats(process, result.getClassLoaderStats());
    }
    if (result.getUrlStats() != null) {
        drawUrlStats(process, result.getUrlStats());
    }
}

private void drawUrlStats(CommandProcess process, Map<ClassLoaderVO, ClassLoaderUrlStat> urlStats) {
    for (Entry<ClassLoaderVO, ClassLoaderUrlStat> entry : urlStats.entrySet()) {
        ClassLoaderVO classLoaderVO = entry.getKey();
        ClassLoaderUrlStat urlStat = entry.getValue();

        // 忽略 sun.reflect.DelegatingClassLoader 等动态ClassLoader
        if (urlStat.getUsedUrls().isEmpty() && urlStat.getUnUsedUrls().isEmpty()) {
            continue;
        }

        TableElement table = new TableElement().leftCellPadding(1).rightCellPadding(1);
        table.row(new LabelElement(classLoaderVO.getName() + ", hash:" + classLoaderVO.getHash())
                .style(Decoration.bold.bold()));
        Collection<String> usedUrls = urlStat.getUsedUrls();
        table.row(new LabelElement("Used URLs:").style(Decoration.bold.bold()));
        for (String url : usedUrls) {
            table.row(url);
        }
        Collection<String> UnnsedUrls = urlStat.getUnUsedUrls();
        table.row(new LabelElement("Unused URLs:").style(Decoration.bold.bold()));
        for (String url : UnnsedUrls) {
            table.row(url);
        }
        process.write(RenderUtil.render(table, process.width()))
                .write("\n");
    }
}

private void drawClassLoaderStats(CommandProcess process, Map<String, ClassLoaderStat> classLoaderStats) {
    Element element = renderStat(classLoaderStats);
    process.write(RenderUtil.render(element, process.width()))
            .write(com.taobao.arthas.core.util.Constants.EMPTY_STRING);

}

