public void start(Consumer<TtyConnection> handler, final Consumer<Throwable> doneHandler) {
    group = new NioEventLoopGroup(new DefaultThreadFactory("arthas-NettyWebsocketTtyBootstrap", true));

    if (this.port > 0) {
        ServerBootstrap b = new ServerBootstrap();
        b.group(group).channel(NioServerSocketChannel.class).handler(new LoggingHandler(LogLevel.INFO))
                .childHandler(new TtyServerInitializer(channelGroup, handler, workerGroup, httpSessionManager));

        final ChannelFuture f = b.bind(host, port);
        f.addListener(new GenericFutureListener<Future<? super Void>>() {
            @Override
            public void operationComplete(Future<? super Void> future) throws Exception {
                if (future.isSuccess()) {
                    channel = f.channel();
                    doneHandler.accept(null);
                } else {
                    doneHandler.accept(future.cause());
                }
            }
        });
    }

    // listen local address in VM communication
    ServerBootstrap b2 = new ServerBootstrap();
    b2.group(group).channel(LocalServerChannel.class).handler(new LoggingHandler(LogLevel.INFO))
            .childHandler(new LocalTtyServerInitializer(channelGroup, handler, workerGroup));

    ChannelFuture bindLocalFuture = b2.bind(new LocalAddress(ArthasConstants.NETTY_LOCAL_ADDRESS));
    if (this.port < 0) { // 保证回调doneHandler
        bindLocalFuture.addListener(new GenericFutureListener<Future<? super Void>>() {
            @Override
            public void operationComplete(Future<? super Void> future) throws Exception {
                if (future.isSuccess()) {
                    doneHandler.accept(null);
                } else {
                    doneHandler.accept(future.cause());
                }
            }
        });
    }
}

@Override
public void operationComplete(Future<? super Void> future) throws Exception {
    if (future.isSuccess()) {
        channel = f.channel();
        doneHandler.accept(null);
    } else {
        doneHandler.accept(future.cause());
    }
}

@Override
public void operationComplete(Future<? super Void> future) throws Exception {
    if (future.isSuccess()) {
        doneHandler.accept(null);
    } else {
        doneHandler.accept(future.cause());
    }
}

public CompletableFuture<Void> start(Consumer<TtyConnection> handler) {
    CompletableFuture<Void> fut = new CompletableFuture<Void>();
    start(handler, Helper.startedHandler(fut));
    return fut;
}

public void stop(final Consumer<Throwable> doneHandler) {
    if (channel != null) {
        channel.close();
    }

    channelGroup.close().addListener(new GenericFutureListener<Future<? super Void>>() {
        @Override
        public void operationComplete(Future<? super Void> future) throws Exception {
            try {
                doneHandler.accept(future.cause());
            } finally {
                group.shutdownGracefully();
            }
        }
    });
}

@Override
public void operationComplete(Future<? super Void> future) throws Exception {
    try {
        doneHandler.accept(future.cause());
    } finally {
        group.shutdownGracefully();
    }
}

public CompletableFuture<Void> stop() {
    CompletableFuture<Void> fut = new CompletableFuture<Void>();
    stop(Helper.stoppedHandler(fut));
    return fut;
}

@Override
protected void channelRead0(ChannelHandlerContext ctx, FullHttpRequest request) throws Exception {
    String path = new URI(request.uri()).getPath();
    if (wsUri.equalsIgnoreCase(path)) {
        ctx.fireChannelRead(request.retain());
    } else {
        if (HttpUtil.is100ContinueExpected(request)) {
            send100Continue(ctx);
        }

        HttpResponse response = null;
        if ("/".equals(path)) {
            path = "/index.html";
        }

        boolean isFileResponseFinished = false;
        try {
            //handle http restful api
            if ("/api".equals(path)) {
                response = httpApiHandler.handle(ctx, request);
            }

            //handle webui requests
            if (path.equals("/ui")) {
                response = createRedirectResponse(request, "/ui/");
            }
            if (path.equals("/ui/")) {
                path += "index.html";
            }

            //try classpath resource first
            if (response == null) {
                response = readFileFromResource(request, path);
            }

            //try output dir later, avoid overlay classpath resources files
            if (response == null) {
                response = DirectoryBrowser.directView(dir, path, request, ctx);
                isFileResponseFinished = response != null;
            }

            //not found
            if (response == null) {
                response = createResponse(request, HttpResponseStatus.NOT_FOUND, "Not found");
            }
        } catch (Throwable e) {
            logger.error("arthas process http request error: " + request.uri(), e);
        } finally {
            //If it is null, an error may occur
            if (response == null) {
                response = createResponse(request, HttpResponseStatus.INTERNAL_SERVER_ERROR, "Server error");
            }
            if (!isFileResponseFinished) {
                ChannelFuture future = writeResponse(ctx, response);
                future.addListener(ChannelFutureListener.CLOSE);
            }
        }
    }
}

private ChannelFuture writeResponse(ChannelHandlerContext ctx, HttpResponse response) {
    // try to add content-length header for DefaultFullHttpResponse
    if (!HttpUtil.isTransferEncodingChunked(response)
        && response instanceof DefaultFullHttpResponse) {
        response.headers().set(HttpHeaderNames.CONNECTION, HttpHeaderValues.CLOSE);
        response.headers().set(HttpHeaderNames.CONTENT_LENGTH,
            ((DefaultFullHttpResponse) response).content().readableBytes());
        return ctx.writeAndFlush(response);
    }

    //chunk response
    ctx.write(response);
    return ctx.writeAndFlush(LastHttpContent.EMPTY_LAST_CONTENT);
}

private HttpResponse readFileFromResource(FullHttpRequest request, String path) throws IOException {
    DefaultFullHttpResponse fullResp = null;
    InputStream in = null;
    try {
        URL res = HttpTtyConnection.class.getResource("/com/taobao/arthas/core/http" + path);
        if (res != null) {
            fullResp = new DefaultFullHttpResponse(request.protocolVersion(),
                HttpResponseStatus.OK);
            in = res.openStream();
            byte[] tmp = new byte[256];
            for (int l = 0; l != -1; l = in.read(tmp)) {
                fullResp.content().writeBytes(tmp, 0, l);
            }
            int li = path.lastIndexOf('.');
            if (li != -1 && li != path.length() - 1) {
                String ext = path.substring(li + 1);
                String contentType;
                if ("html".equals(ext)) {
                    contentType = "text/html";
                } else if ("js".equals(ext)) {
                    contentType = "application/javascript";
                } else if ("css".equals(ext)) {
                    contentType = "text/css";
                } else {
                    contentType = null;
                }

                if (contentType != null) {
                    fullResp.headers().set(HttpHeaderNames.CONTENT_TYPE, contentType);
                }
            }
        }
    } finally {
        IOUtils.close(in);
    }
    return fullResp;
}

private static void send100Continue(ChannelHandlerContext ctx) {
    FullHttpResponse response = new DefaultFullHttpResponse(HTTP_1_1, HttpResponseStatus.CONTINUE);
    ctx.writeAndFlush(response);
}

public void exceptionCaught(ChannelHandlerContext ctx, Throwable cause) throws Exception {
    Logging.logReportedIoError(cause);
    ctx.close();
}

