@Override
public String toString() {

    final Map<String, String> map = new HashMap<String, String>();
    for (Field field : ArthasReflectUtils.getFields(Configure.class)) {

        // 过滤掉静态类
        if (isStatic(field.getModifiers())) {
            continue;
        }

        // 非静态的才需要纳入非序列化过程
        try {
            Object fieldValue = ArthasReflectUtils.getFieldValueByField(this, field);
            if (fieldValue != null) {
                map.put(field.getName(), String.valueOf(fieldValue));
            }
        } catch (Throwable t) {
            //
        }

    }

    return FeatureCodec.DEFAULT_COMMANDLINE_CODEC.toString(map);
}

public static Configure toConfigure(String toString) throws IllegalAccessException {
    final Configure configure = new Configure();
    final Map<String, String> map = FeatureCodec.DEFAULT_COMMANDLINE_CODEC.toMap(toString);

    for (Map.Entry<String, String> entry : map.entrySet()) {
        final Field field = ArthasReflectUtils.getField(Configure.class, entry.getKey());
        if (null != field && !isStatic(field.getModifiers())) {
            ArthasReflectUtils.set(field, ArthasReflectUtils.valueOf(field.getType(), entry.getValue()), configure);
        }
    }
    return configure;
}

public static void inject(Environment environment, Object instance) {
    inject(environment, null, null, instance);
}

public static void inject(Environment environment, String prefix, Object instance) {
    inject(environment, null, prefix, instance);
}

public static void inject(Environment environment, String parentPrefix, String prefix, Object instance) {
    if (prefix == null) {
        prefix = "";
    }
    Class<? extends Object> type = instance.getClass();
    try {
        Config annotation = type.getAnnotation(Config.class);

        if (annotation == null) {
            prefix = parentPrefix + '.' + prefix;
        } else {
            prefix = annotation.prefix();
            if (prefix != null) {
                if (parentPrefix != null && parentPrefix.length() > 0) {
                    prefix = parentPrefix + '.' + prefix;
                }
            }
        }

        Method[] declaredMethods = type.getDeclaredMethods();
        // 获取到所有setter方法，再提取出field。根据前缀从 properties里取出值，再尝试用setter方法注入到对象里
        for (Method method : declaredMethods) {
            String methodName = method.getName();
            Class<?>[] parameterTypes = method.getParameterTypes();

            if (parameterTypes.length == 1 && methodName.startsWith("set") && methodName.length() > "set".length()) {

                String field = getFieldNameFromSetterMethod(methodName);
                String configKey = prefix + '.' + field;
                if (environment.containsProperty(configKey)) {
                    Object reslovedValue = environment.getProperty(prefix + '.' + field, parameterTypes[0]);
                    if (reslovedValue != null) {
                        method.invoke(instance, new Object[] { reslovedValue });
                    }
                }
            }
        }

    } catch (Exception e) {
        throw new RuntimeException("inject error. prefix: " + prefix + ", instance: " + instance, e);
    }

    // process @NestedConfig
    Field[] fields = type.getDeclaredFields();
    for (Field field : fields) {
        NestedConfig nestedConfig = field.getAnnotation(NestedConfig.class);
        if (nestedConfig != null) {
            String prefixForField = field.getName();
            if (parentPrefix != null && prefix.length() > 0) {
                prefixForField = prefix + '.' + prefixForField;
            }

            field.setAccessible(true);
            try {
                Object fieldValue = field.get(instance);
                if (fieldValue == null) {
                    fieldValue = field.getType().newInstance();
                }
                inject(environment, prefix, prefixForField, fieldValue);

                field.set(instance, fieldValue);
            } catch (Exception e) {
                throw new RuntimeException("process @NestedConfig error, field: " + field + ", prefix: "
                        + prefix + ", instance: " + instance, e);
            }
        }
    }
}

private static String getFieldNameFromSetterMethod(String methodName) {
    String field = methodName.substring("set".length());
    String startPart = field.substring(0, 1).toLowerCase();
    String endPart = field.substring(1);

    field = startPart + endPart;
    return field;
}

public String toString(final Map<String, String> map) {

    final StringBuilder featureSB = new StringBuilder().append(kvSegmentSeparator);

    if (null == map
            || map.isEmpty()) {
        return featureSB.toString();
    }

    for (Map.Entry<String, String> entry : map.entrySet()) {

        featureSB
                .append(escapeEncode(entry.getKey()))
                .append(kvSeparator)
                .append(escapeEncode(entry.getValue()))
                .append(kvSegmentSeparator)
        ;

    }

    return featureSB.toString();
}

public Map<String, String> toMap(final String featureString) {

    final Map<String, String> map = new HashMap<String, String>();

    if (isBlank(featureString)) {
        return map;
    }

    for (String kv : escapeSplit(featureString, kvSegmentSeparator)) {

        if (isBlank(kv)) {
            // 过滤掉为空的字符串片段
            continue;
        }

        final String[] ar = escapeSplit(kv, kvSeparator);
        if (ar.length != 2) {
            // 过滤掉不符合K:V单目的情况
            continue;
        }

        final String k = ar[0];
        final String v = ar[1];
        if (!isBlank(k)
                && !isBlank(v)) {
            map.put(escapeDecode(k), escapeDecode(v));
        }

    }

    return map;
}

private String escapeEncode(final String string) {
    final StringBuilder returnSB = new StringBuilder();
    for (final char c : string.toCharArray()) {
        if (isIn(c, kvSegmentSeparator, kvSeparator, ESCAPE_PREFIX_CHAR)) {
            returnSB.append(ESCAPE_PREFIX_CHAR);
        }
        returnSB.append(c);
    }

    return returnSB.toString();
}

private String escapeDecode(String string) {

    final StringBuilder segmentSB = new StringBuilder();
    final int stringLength = string.length();

    for (int index = 0; index < stringLength; index++) {

        final char c = string.charAt(index);

        if (isEquals(c, ESCAPE_PREFIX_CHAR)
                && index < stringLength - 1) {

            final char nextChar = string.charAt(++index);

            // 下一个字符是转义符
            if (isIn(nextChar, kvSegmentSeparator, kvSeparator, ESCAPE_PREFIX_CHAR)) {
                segmentSB.append(nextChar);
            }

            // 如果不是转义字符，则需要两个都放入
            else {
                segmentSB.append(c);
                segmentSB.append(nextChar);
            }
        } else {
            segmentSB.append(c);
        }

    }

    return segmentSB.toString();
}

private String[] escapeSplit(String string, char splitEscapeChar) {

    final ArrayList<String> segmentArrayList = new ArrayList<String>();
    final Stack<Character> decodeStack = new Stack<Character>();
    final int stringLength = string.length();

    for (int index = 0; index < stringLength; index++) {

        boolean isArchive = false;

        final char c = string.charAt(index);

        // 匹配到转义前缀符
        if (isEquals(c, ESCAPE_PREFIX_CHAR)) {

            decodeStack.push(c);
            if (index < stringLength - 1) {
                final char nextChar = string.charAt(++index);
                decodeStack.push(nextChar);
            }

        }

        // 匹配到分割符
        else if (isEquals(c, splitEscapeChar)) {
            isArchive = true;
        }

        // 匹配到其他字符
        else {
            decodeStack.push(c);
        }

        if (isArchive
                || index == stringLength - 1) {
            final StringBuilder segmentSB = new StringBuilder(decodeStack.size());
            while (!decodeStack.isEmpty()) {
                segmentSB.append(decodeStack.pop());
            }

            segmentArrayList.add(
                    segmentSB
                            .reverse()  // 因为堆栈中是逆序的,所以需要对逆序的字符串再次逆序
                            .toString() // toString
                            .trim()     // 考虑到字符串片段可能会出现首尾空格的场景，这里做一个过滤
            );
        }

    }

    return segmentArrayList.toArray(new String[0]);
}

private Configure parse(String[] args) {
    Option pid = new TypedOption<Long>().setType(Long.class).setShortName("pid").setRequired(true);
    Option core = new TypedOption<String>().setType(String.class).setShortName("core").setRequired(true);
    Option agent = new TypedOption<String>().setType(String.class).setShortName("agent").setRequired(true);
    Option target = new TypedOption<String>().setType(String.class).setShortName("target-ip");
    Option telnetPort = new TypedOption<Integer>().setType(Integer.class)
            .setShortName("telnet-port");
    Option httpPort = new TypedOption<Integer>().setType(Integer.class)
            .setShortName("http-port");
    Option sessionTimeout = new TypedOption<Integer>().setType(Integer.class)
                    .setShortName("session-timeout");

    Option username = new TypedOption<String>().setType(String.class).setShortName("username");
    Option password = new TypedOption<String>().setType(String.class).setShortName("password");

    Option tunnelServer = new TypedOption<String>().setType(String.class).setShortName("tunnel-server");
    Option agentId = new TypedOption<String>().setType(String.class).setShortName("agent-id");
    Option appName = new TypedOption<String>().setType(String.class).setShortName(ArthasConstants.APP_NAME);

    Option statUrl = new TypedOption<String>().setType(String.class).setShortName("stat-url");
    Option disabledCommands = new TypedOption<String>().setType(String.class).setShortName("disabled-commands");

    CLI cli = CLIs.create("arthas").addOption(pid).addOption(core).addOption(agent).addOption(target)
            .addOption(telnetPort).addOption(httpPort).addOption(sessionTimeout)
            .addOption(username).addOption(password)
            .addOption(tunnelServer).addOption(agentId).addOption(appName).addOption(statUrl).addOption(disabledCommands);
    CommandLine commandLine = cli.parse(Arrays.asList(args));

    Configure configure = new Configure();
    configure.setJavaPid((Long) commandLine.getOptionValue("pid"));
    configure.setArthasAgent((String) commandLine.getOptionValue("agent"));
    configure.setArthasCore((String) commandLine.getOptionValue("core"));
    if (commandLine.getOptionValue("session-timeout") != null) {
        configure.setSessionTimeout((Integer) commandLine.getOptionValue("session-timeout"));
    }

    if (commandLine.getOptionValue("target-ip") != null) {
        configure.setIp((String) commandLine.getOptionValue("target-ip"));
    }

    if (commandLine.getOptionValue("telnet-port") != null) {
        configure.setTelnetPort((Integer) commandLine.getOptionValue("telnet-port"));
    }
    if (commandLine.getOptionValue("http-port") != null) {
        configure.setHttpPort((Integer) commandLine.getOptionValue("http-port"));
    }

    configure.setUsername((String) commandLine.getOptionValue("username"));
    configure.setPassword((String) commandLine.getOptionValue("password"));

    configure.setTunnelServer((String) commandLine.getOptionValue("tunnel-server"));
    configure.setAgentId((String) commandLine.getOptionValue("agent-id"));
    configure.setStatUrl((String) commandLine.getOptionValue("stat-url"));
    configure.setDisabledCommands((String) commandLine.getOptionValue("disabled-commands"));
    configure.setAppName((String) commandLine.getOptionValue(ArthasConstants.APP_NAME));
    return configure;
}

private void attachAgent(Configure configure) throws Exception {
    VirtualMachineDescriptor virtualMachineDescriptor = null;
    for (VirtualMachineDescriptor descriptor : VirtualMachine.list()) {
        String pid = descriptor.id();
        if (pid.equals(Long.toString(configure.getJavaPid()))) {
            virtualMachineDescriptor = descriptor;
            break;
        }
    }
    VirtualMachine virtualMachine = null;
    try {
        if (null == virtualMachineDescriptor) { // 使用 attach(String pid) 这种方式
            virtualMachine = VirtualMachine.attach("" + configure.getJavaPid());
        } else {
            virtualMachine = VirtualMachine.attach(virtualMachineDescriptor);
        }

        Properties targetSystemProperties = virtualMachine.getSystemProperties();
        String targetJavaVersion = JavaVersionUtils.javaVersionStr(targetSystemProperties);
        String currentJavaVersion = JavaVersionUtils.javaVersionStr();
        if (targetJavaVersion != null && currentJavaVersion != null) {
            if (!targetJavaVersion.equals(currentJavaVersion)) {
                AnsiLog.warn("Current VM java version: {} do not match target VM java version: {}, attach may fail.",
                                currentJavaVersion, targetJavaVersion);
                AnsiLog.warn("Target VM JAVA_HOME is {}, arthas-boot JAVA_HOME is {}, try to set the same JAVA_HOME.",
                                targetSystemProperties.getProperty("java.home"), System.getProperty("java.home"));
            }
        }

        String arthasAgentPath = configure.getArthasAgent();
        //convert jar path to unicode string
        configure.setArthasAgent(encodeArg(arthasAgentPath));
        configure.setArthasCore(encodeArg(configure.getArthasCore()));
        try {
            virtualMachine.loadAgent(arthasAgentPath,
                    configure.getArthasCore() + ";" + configure.toString());
        } catch (IOException e) {
            if (e.getMessage() != null && e.getMessage().contains("Non-numeric value found")) {
                AnsiLog.warn(e);
                AnsiLog.warn("It seems to use the lower version of JDK to attach the higher version of JDK.");
                AnsiLog.warn(
                        "This error message can be ignored, the attach may have been successful, and it will still try to connect.");
            } else {
                throw e;
            }
        } catch (com.sun.tools.attach.AgentLoadException ex) {
            if ("0".equals(ex.getMessage())) {
                // https://stackoverflow.com/a/54454418
                AnsiLog.warn(ex);
                AnsiLog.warn("It seems to use the higher version of JDK to attach the lower version of JDK.");
                AnsiLog.warn(
                        "This error message can be ignored, the attach may have been successful, and it will still try to connect.");
            } else {
                throw ex;
            }
        }
    } finally {
        if (null != virtualMachine) {
            virtualMachine.detach();
        }
    }
}

private static String encodeArg(String arg) {
    try {
        return URLEncoder.encode(arg, "utf-8");
    } catch (UnsupportedEncodingException e) {
        return arg;
    }
}

public static void main(String[] args) {
    try {
        new Arthas(args);
    } catch (Throwable t) {
        AnsiLog.error("Start arthas failed, exception stack trace: ");
        t.printStackTrace();
        System.exit(-1);
    }
}

public static void updateOnglStrict(boolean strict) {
    try {
        Field field = OgnlRuntime.class.getDeclaredField("_useStricterInvocation");
        field.setAccessible(true);
        // 获取字段的内存偏移量和基址
        Object staticFieldBase = UnsafeUtils.UNSAFE.staticFieldBase(field);
        long staticFieldOffset = UnsafeUtils.UNSAFE.staticFieldOffset(field);

        // 修改字段的值
        UnsafeUtils.UNSAFE.putBoolean(staticFieldBase, staticFieldOffset, strict);
    } catch (NoSuchFieldException | SecurityException e) {
        // ignore
    }
}

