public static void setCookie(DefaultFullHttpResponse response, String name, String value) {
    response.headers().add(HttpHeaderNames.SET_COOKIE, ServerCookieEncoder.STRICT.encode(name, value));
}

public static DefaultHttpResponse createResponse(FullHttpRequest request, HttpResponseStatus status, String content) {
    DefaultFullHttpResponse response = new DefaultFullHttpResponse(request.protocolVersion(), status);
    response.headers().set(HttpHeaderNames.CONTENT_TYPE, "text/html; charset=utf-8");
    try {
        response.content().writeBytes(content.getBytes("UTF-8"));
    } catch (UnsupportedEncodingException e) {
    }
    return response;
}

public static HttpResponse createRedirectResponse(FullHttpRequest request, String url) {
    DefaultFullHttpResponse response = new DefaultFullHttpResponse(request.protocolVersion(), HttpResponseStatus.FOUND);
    response.headers().set(HttpHeaderNames.LOCATION, url);
    return response;
}

public static byte[] toByteArray(InputStream input) throws IOException {
    ByteArrayOutputStream output = new ByteArrayOutputStream();
    copy(input, output);
    return output.toByteArray();
}

public static int copy(InputStream input, OutputStream output) throws IOException {
    long count = copyLarge(input, output);
    if (count > Integer.MAX_VALUE) {
        return -1;
    }
    return (int) count;
}

public static long copyLarge(InputStream input, OutputStream output)
        throws IOException {
    return copyLarge(input, output, new byte[DEFAULT_BUFFER_SIZE]);
}

public static long copyLarge(InputStream input, OutputStream output, byte[] buffer)
        throws IOException {
    long count = 0;
    int n = 0;
    while (EOF != (n = input.read(buffer))) {
        output.write(buffer, 0, n);
        count += n;
    }
    return count;
}

public static String toString(InputStream input) throws IOException {
    BufferedReader br = null;
    try {
        StringBuilder sb = new StringBuilder();
        br = new BufferedReader(new InputStreamReader(input));
        String line;
        while ((line = br.readLine()) != null) {
            sb.append(line).append("\n");
        }
        return sb.toString();
    } finally {
        if (br != null) {
            try {
                br.close();
            } catch (IOException e) {
                // ignore
            }
        }
    }
}

public static void retransformClasses(Instrumentation inst, ClassFileTransformer transformer,
        Set<Class<?>> classes) {
    try {
        inst.addTransformer(transformer, true);

        for (Class<?> clazz : classes) {
            if (ClassUtils.isLambdaClass(clazz)) {
                logger.info(
                        "ignore lambda class: {}, because jdk do not support retransform lambda class: https://github.com/alibaba/arthas/issues/1512.",
                        clazz.getName());
                continue;
            }
            try {
                inst.retransformClasses(clazz);
            } catch (Throwable e) {
                String errorMsg = "retransformClasses class error, name: " + clazz.getName();
                logger.error(errorMsg, e);
            }
        }
    } finally {
        inst.removeTransformer(transformer);
    }
}

public static void trigerRetransformClasses(Instrumentation inst, Collection<String> classes) {
    for (Class<?> clazz : inst.getAllLoadedClasses()) {
        if (classes.contains(clazz.getName())) {
            try {
                inst.retransformClasses(clazz);
            } catch (Throwable e) {
                String errorMsg = "retransformClasses class error, name: " + clazz.getName();
                logger.error(errorMsg, e);
            }
        }
    }
}

public static void end(CommandProcess process, ExitStatus status) {
    if (status != null) {
        process.end(status.getStatusCode(), status.getMessage());
    } else {
        process.end(-1, "process error, exit status is null");
    }
}

