    }//for
    return null;
}

public static <T> T getFieldValueByField(Object target, Field field) throws IllegalArgumentException, IllegalAccessException {
    final boolean isAccessible = field.isAccessible();
    try {
        field.setAccessible(true);
        //noinspection unchecked
        return (T) field.get(target);
    } finally {
        field.setAccessible(isAccessible);
    }
}

@SuppressWarnings("unchecked")
public static <T> T valueOf(Class<T> t, String value) {
    if (ArthasCheckUtils.isIn(t, int.class, Integer.class)) {
        return (T) Integer.valueOf(value);
    } else if (ArthasCheckUtils.isIn(t, long.class, Long.class)) {
        return (T) Long.valueOf(value);
    } else if (ArthasCheckUtils.isIn(t, double.class, Double.class)) {
        return (T) Double.valueOf(value);
    } else if (ArthasCheckUtils.isIn(t, float.class, Float.class)) {
        return (T) Float.valueOf(value);
    } else if (ArthasCheckUtils.isIn(t, char.class, Character.class)) {
        return (T) Character.valueOf(value.charAt(0));
    } else if (ArthasCheckUtils.isIn(t, byte.class, Byte.class)) {
        return (T) Byte.valueOf(value);
    } else if (ArthasCheckUtils.isIn(t, boolean.class, Boolean.class)) {
        return (T) Boolean.valueOf(value);
    } else if (ArthasCheckUtils.isIn(t, short.class, Short.class)) {
        return (T) Short.valueOf(value);
    } else if (ArthasCheckUtils.isIn(t, String.class)) {
        return (T) value;
    } else {
        return null;
    }
}

public static Class<?> defineClass(
        final ClassLoader targetClassLoader,
        final String className,
        final byte[] classByteArray) throws NoSuchMethodException, InvocationTargetException, IllegalAccessException {

    final Method defineClassMethod = ClassLoader.class.getDeclaredMethod(
            "defineClass",
            String.class,
            byte[].class,
            int.class,
            int.class
    );

    synchronized (defineClassMethod) {
        final boolean acc = defineClassMethod.isAccessible();
        try {
            defineClassMethod.setAccessible(true);
            return (Class<?>) defineClassMethod.invoke(
                    targetClassLoader,
                    className,
                    classByteArray,
                    0,
                    classByteArray.length
            );
        } finally {
            defineClassMethod.setAccessible(acc);
        }
    }


}

public static Object readDeclaredField(final Object target, final String fieldName) throws IllegalAccessException {
    return readDeclaredField(target, fieldName, false);
}

public static Object readDeclaredField(final Object target, final String fieldName, final boolean forceAccess) throws IllegalAccessException {
    isTrue(target != null, "target object must not be null");
    final Class<?> cls = target.getClass();
    final Field field = getDeclaredField(cls, fieldName, forceAccess);
    isTrue(field != null, "Cannot locate declared field %s.%s", cls, fieldName);
    // already forced access above, don't repeat it here:
    return readField(field, target, false);
}

public static Field getDeclaredField(final Class<?> cls, final String fieldName, final boolean forceAccess) {
    isTrue(cls != null, "The class must not be null");
    isTrue(!StringUtils.isBlank(fieldName), "The field name must not be blank/empty");
    try {
        // only consider the specified class by using getDeclaredField()
        final Field field = cls.getDeclaredField(fieldName);
        if (!isAccessible(field)) {
            if (forceAccess) {
                field.setAccessible(true);
            } else {
                return null;
            }
        }
        return field;
    } catch (final NoSuchFieldException e) { // NOPMD
        // ignore
    }
    return null;
}

public static Object readField(final Field field, final Object target, final boolean forceAccess) throws IllegalAccessException {
    isTrue(field != null, "The field must not be null");
    if (forceAccess && !field.isAccessible()) {
        field.setAccessible(true);
    } else {
        setAccessibleWorkaround(field);
    }
    return field.get(target);
}

public static Object readStaticField(final Field field) throws IllegalAccessException {
    return readStaticField(field, false);
}

public static Object readStaticField(final Field field, final boolean forceAccess) throws IllegalAccessException {
    isTrue(field != null, "The field must not be null");
    isTrue(Modifier.isStatic(field.getModifiers()), "The field '%s' is not static", field.getName());
    return readField(field, (Object) null, forceAccess);
}

public static void writeStaticField(final Field field, final Object value) throws IllegalAccessException {
    writeStaticField(field, value, false);
}

public static void writeStaticField(final Field field, final Object value, final boolean forceAccess) throws IllegalAccessException {
    isTrue(field != null, "The field must not be null");
    isTrue(Modifier.isStatic(field.getModifiers()), "The field %s.%s is not static", field.getDeclaringClass().getName(),
            field.getName());
    writeField(field, (Object) null, value, forceAccess);
}

public static void writeField(final Field field, final Object target, final Object value, final boolean forceAccess)
        throws IllegalAccessException {
    isTrue(field != null, "The field must not be null");
    if (forceAccess && !field.isAccessible()) {
        field.setAccessible(true);
    } else {
        setAccessibleWorkaround(field);
    }
    field.set(target, value);
}

public static Field[] getAllFields(final Class<?> cls) {
    final List<Field> allFieldsList = getAllFieldsList(cls);
    return allFieldsList.toArray(new Field[0]);
}

public static List<Field> getAllFieldsList(final Class<?> cls) {
    isTrue(cls != null, "The class must not be null");
    final List<Field> allFields = new ArrayList<Field>();
    Class<?> currentClass = cls;
    while (currentClass != null) {
        final Field[] declaredFields = currentClass.getDeclaredFields();
        allFields.addAll(Arrays.asList(declaredFields));
        currentClass = currentClass.getSuperclass();
    }
    return allFields;
}

public static Field getField(final Class<?> cls, final String fieldName) {
    final Field field = getField(cls, fieldName, false);
    setAccessibleWorkaround(field);
    return field;
}

public static Field getField(final Class<?> cls, final String fieldName, final boolean forceAccess) {
    isTrue(cls != null, "The class must not be null");
    isTrue(!StringUtils.isBlank(fieldName), "The field name must not be blank/empty");
    // FIXME is this workaround still needed? lang requires Java 6
    // Sun Java 1.3 has a bugged implementation of getField hence we write the
    // code ourselves

    // getField() will return the Field object with the declaring class
    // set correctly to the class that declares the field. Thus requesting the
    // field on a subclass will return the field from the superclass.
    //
    // priority order for lookup:
    // searchclass private/protected/package/public
    // superclass protected/package/public
    // private/different package blocks access to further superclasses
    // implementedinterface public

    // check up the superclass hierarchy
    for (Class<?> acls = cls; acls != null; acls = acls.getSuperclass()) {
        try {
            final Field field = acls.getDeclaredField(fieldName);
            // getDeclaredField checks for non-public scopes as well
            // and it returns accurate results
            if (!Modifier.isPublic(field.getModifiers())) {
                if (forceAccess) {
                    field.setAccessible(true);
                } else {
                    continue;
                }
            }
            return field;
        } catch (final NoSuchFieldException ex) { // NOPMD
            // ignore
        }
    }
    // check the public interface case. This must be manually searched for
    // incase there is a public supersuperclass field hidden by a private/package
    // superclass field.
    Field match = null;
    for (final Class<?> class1 : getAllInterfaces(cls)) {
        try {
            final Field test = class1.getField(fieldName);
            isTrue(match == null, "Reference to field %s is ambiguous relative to %s"
                    + "; a matching field exists on two or more implemented interfaces.", fieldName, cls);
            match = test;
        } catch (final NoSuchFieldException ex) { // NOPMD
            // ignore
        }
    }
    return match;
}

public static List<Class<?>> getAllInterfaces(final Class<?> cls) {
    if (cls == null) {
        return null;
    }

    final LinkedHashSet<Class<?>> interfacesFound = new LinkedHashSet<Class<?>>();
    getAllInterfaces(cls, interfacesFound);

    return new ArrayList<Class<?>>(interfacesFound);
}

private static void getAllInterfaces(Class<?> cls, final HashSet<Class<?>> interfacesFound) {
    while (cls != null) {
        final Class<?>[] interfaces = cls.getInterfaces();

        for (final Class<?> i : interfaces) {
            if (interfacesFound.add(i)) {
                getAllInterfaces(i, interfacesFound);
            }
        }

        cls = cls.getSuperclass();
    }
}

static boolean setAccessibleWorkaround(final AccessibleObject o) {
    if (o == null || o.isAccessible()) {
        return false;
    }
    final Member m = (Member) o;
    if (!o.isAccessible() && Modifier.isPublic(m.getModifiers()) && isPackageAccess(m.getDeclaringClass().getModifiers())) {
        try {
            o.setAccessible(true);
            return true;
        } catch (final SecurityException e) { // NOPMD
            // ignore in favor of subsequent IllegalAccessException
        }
    }
    return false;
}

static boolean isPackageAccess(final int modifiers) {
    return (modifiers & ACCESS_TEST) == 0;
}

static boolean isAccessible(final Member m) {
    return m != null && Modifier.isPublic(m.getModifiers()) && !m.isSynthetic();
}

static void isTrue(final boolean expression, final String message, final Object... values) {
    if (!expression) {
        throw new IllegalArgumentException(String.format(message, values));
    }
}

public static boolean isWindowsOS() {
    String osName = System.getProperty(OS_NAME);
    return osName.toLowerCase().contains(WINDOWS);
}

public static String getLocalIP() {
    InetAddress ip = null;
    try {
        if (isWindowsOS()) {
            ip = InetAddress.getLocalHost();
        } else {
            // scan all NetWorkInterfaces if it's loopback address
            if (!InetAddress.getLocalHost().isLoopbackAddress()) {
                ip = InetAddress.getLocalHost();
            } else {
                boolean bFindIP = false;
                Enumeration<NetworkInterface> netInterfaces = NetworkInterface.getNetworkInterfaces();
                while (netInterfaces.hasMoreElements()) {
                    if (bFindIP) {
                        break;
                    }
                    NetworkInterface ni = netInterfaces.nextElement();
                    // ----------特定情况，可以考虑用ni.getName判断
                    // iterator all IPs
                    Enumeration<InetAddress> ips = ni.getInetAddresses();
                    while (ips.hasMoreElements()) {
                        ip = ips.nextElement();
                        // IP starts with 127. is loopback address
                        if (ip.isSiteLocalAddress() && !ip.isLoopbackAddress()
                                && !ip.getHostAddress().contains(":")) {
                            bFindIP = true;
                            break;
                        }
                    }

                }
            }
        }
    } catch (Exception e) {
    }

    return ip == null ? null : ip.getHostAddress();
}

public static boolean isAllZeroIP(String ipStr) {
    if (ipStr == null || ipStr.isEmpty()) {
        return false;
    }
    char[] charArray = ipStr.toCharArray();

    for (char c : charArray) {
        if (c != '0' && c != '.' && c != ':') {
            return false;
        }
    }

    return true;
}

public static Response request(String urlString) {
    HttpURLConnection urlConnection = null;
    InputStream in = null;
    try {
        URL url = new URL(urlString);
        urlConnection = (HttpURLConnection)url.openConnection();
        urlConnection.setConnectTimeout(CONNECT_TIMEOUT);
        urlConnection.setReadTimeout(READ_TIMEOUT);;
        // prefer json to text
        urlConnection.setRequestProperty("Accept", "application/json,text/plain;q=0.2");
        in = urlConnection.getInputStream();
        BufferedReader br = new BufferedReader(new InputStreamReader(in));
        String line = null;
        StringBuilder sb = new StringBuilder();
        while ((line = br.readLine()) != null) {
            sb.append(line).append("\n");
        }
        int statusCode = urlConnection.getResponseCode();
        String result = sb.toString().trim();
        if (statusCode == INTERNAL_SERVER_ERROR) {
            JSONObject errorObj = JSON.parseObject(result);
            if (errorObj.containsKey("errorMsg")) {
                return new Response(errorObj.getString("errorMsg"), false);
            }
            return new Response(result, false);
        }
        return new Response(result);
    } catch (IOException e) {
        return new Response(e.getMessage(), false);
    } finally {
        IOUtils.close(in);
        if (urlConnection != null) {
            urlConnection.disconnect();
        }
    }
}

public static String simpleRequest(String url) {
    BufferedReader br = null;
    try {
        URL obj = new URL(url);
        HttpURLConnection con = (HttpURLConnection) obj.openConnection();
        con.setRequestProperty("Accept", "application/json");
        int responseCode = con.getResponseCode();

        br = new BufferedReader(new InputStreamReader(con.getInputStream()));
        StringBuilder sb = new StringBuilder();
        String line = null;
        while ((line = br.readLine()) != null) {
            sb.append(line);
            sb.append("\n");
        }
        String result = sb.toString().trim();
        if (responseCode == 500) {
            JSONObject errorObj = JSON.parseObject(result);
            if (errorObj.containsKey("errorMsg")) {
                return errorObj.getString("errorMsg");
            }
            return result;
        } else {
            return result;
        }

    } catch (Exception e) {
        return null;
    } finally {
        if (br != null) {
            try {
                br.close();
            } catch (IOException e) {
                // ignore
            }
        }
    }
}

public static Response requestViaSocket(String path) {
    BufferedReader br = null;
    try {
        Socket s = new Socket(QOS_HOST, QOS_PORT);
        PrintWriter pw = new PrintWriter(s.getOutputStream());
        pw.println("GET " + path + " HTTP/1.1");
        pw.println("Host: " + QOS_HOST + ":" + QOS_PORT);
        pw.println("");
        pw.flush();

        br = new BufferedReader(new InputStreamReader(s.getInputStream()));
        StringBuilder sb = new StringBuilder();
        String line = null;
        boolean start = false;
        while ((line = br.readLine()) != null) {
            if (start) {
                sb.append(line).append("\n");
            }
            if (line.equals(QOS_RESPONSE_START_LINE)) {
                start = true;
            }
        }
        String result = sb.toString().trim();
        return new Response(result);
    } catch (Exception e) {
        return new Response(e.getMessage(), false);
    } finally {
        if (br != null) {
            try {
                br.close();
            } catch (IOException e) {
                // ignore
            }
        }
    }
}

