private static String addLineNumber(String src, Map<Integer, Integer> lineMapping) {
    int maxLineNumber = 0;
    for (Integer value : lineMapping.values()) {
        if (value != null && value > maxLineNumber) {
            maxLineNumber = value;
        }
    }

    String formatStr = "/*%2d*/ ";
    String emptyStr = "       ";

    StringBuilder sb = new StringBuilder();

    List<String> lines = StringUtils.toLines(src);

    if (maxLineNumber >= 1000) {
        formatStr = "/*%4d*/ ";
        emptyStr = "         ";
    } else if (maxLineNumber >= 100) {
        formatStr = "/*%3d*/ ";
        emptyStr = "        ";
    }

    int index = 0;
    for (String line : lines) {
        Integer srcLineNumber = lineMapping.get(index + 1);
        if (srcLineNumber != null) {
            sb.append(String.format(formatStr, srcLineNumber));
        } else {
            sb.append(emptyStr);
        }
        sb.append(line).append("\n");
        index++;
    }

    return sb.toString();
}

private void ensureCapacityInternal(int expectDeep) {
    final int currentStackSize = elementArray.length;
    if (elementArray.length <= expectDeep) {
        if (logger.isDebugEnabled()) {
            logger.debug("resize GaStack to double length: " + currentStackSize * 2 + " for thread: "
                    + Thread.currentThread().getName());
        }
        final Object[] newElementArray = new Object[currentStackSize * 2];
        arraycopy(elementArray, 0, newElementArray, 0, currentStackSize);
        this.elementArray = newElementArray;
    }
}

private void checkForPopOrPeek() {
    // stack is empty
    if (isEmpty()) {
        throw new NoSuchElementException();
    }
}

@Override
public E pop() {
    try {
        checkForPopOrPeek();
        E res = (E) elementArray[current];
        elementArray[current] = null;
        current--;
        return res;
    } finally {
        if (current == EMPTY_INDEX && elementArray.length > DEFAULT_STACK_DEEP) {
            elementArray = new Object[DEFAULT_STACK_DEEP];
            if (logger.isDebugEnabled()) {
                logger.debug("resize GaStack to default length for thread: " + Thread.currentThread().getName());
            }
        }
    }
}

@Override
public void push(E e) {
    ensureCapacityInternal(current + 1);
    elementArray[++current] = e;
}

@Override
public E peek() {
    checkForPopOrPeek();
    return (E) elementArray[current];
}

@Override
public boolean isEmpty() {
    return current == EMPTY_INDEX;
}

private void checkForPush() {
    // stack is full
    if (current == max) {
        throw new ArrayIndexOutOfBoundsException();
    }
}

private void checkForPopOrPeek() {
    // stack is empty
    if (isEmpty()) {
        throw new NoSuchElementException();
    }
}

@Override
public E pop() {
    checkForPopOrPeek();
    return (E) elementArray[current--];
}

@Override
public void push(E e) {
    checkForPush();
    elementArray[++current] = e;
}

@Override
public E peek() {
    checkForPopOrPeek();
    return (E) elementArray[current];
}

@Override
public boolean isEmpty() {
    return current == EMPTY_INDEX;
}

public static Set<Class<?>> searchClass(Instrumentation inst, Matcher<String> classNameMatcher, int limit) {
    if (classNameMatcher == null) {
        return Collections.emptySet();
    }
    final Set<Class<?>> matches = new HashSet<Class<?>>();
    for (Class<?> clazz : inst.getAllLoadedClasses()) {
        if (clazz == null) {
            continue;   
        }
        if (classNameMatcher.matching(clazz.getName())) {
            matches.add(clazz);
        }
        if (matches.size() >= limit) {
            break;
        }
    }
    return matches;
}

public static Set<Class<?>> searchClass(Instrumentation inst, Matcher<String> classNameMatcher) {
    return searchClass(inst, classNameMatcher, Integer.MAX_VALUE);
}

public static Set<Class<?>> searchClass(Instrumentation inst, String classPattern, boolean isRegEx) {
    Matcher<String> classNameMatcher = classNameMatcher(classPattern, isRegEx);
    return GlobalOptions.isDisableSubClass ? searchClass(inst, classNameMatcher) :
            searchSubClass(inst, searchClass(inst, classNameMatcher));
}

public static Set<Class<?>> searchClass(Instrumentation inst, String classPattern, boolean isRegEx, String code) {
    Set<Class<?>> matchedClasses = searchClass(inst, classPattern, isRegEx);
    return filter(matchedClasses, code);
}

public static Set<Class<?>> searchClassOnly(Instrumentation inst, String classPattern, boolean isRegEx) {
    Matcher<String> classNameMatcher = classNameMatcher(classPattern, isRegEx);
    return searchClass(inst, classNameMatcher);
}

public static Set<Class<?>> searchClassOnly(Instrumentation inst, String classPattern, int limit) {
    Matcher<String> classNameMatcher = classNameMatcher(classPattern, false);
    return searchClass(inst, classNameMatcher, limit);
}

public static Set<Class<?>> searchClassOnly(Instrumentation inst, String classPattern, boolean isRegEx, String code) {
    Set<Class<?>> matchedClasses = searchClassOnly(inst, classPattern, isRegEx);
    return filter(matchedClasses, code);
}

private static Set<Class<?>> filter(Set<Class<?>> matchedClasses, String code) {
    if (code == null) {
        return matchedClasses;
    }

    Set<Class<?>> result = new HashSet<Class<?>>();
    if (matchedClasses != null) {
        for (Class<?> c : matchedClasses) {
            if (c.getClassLoader() != null && Integer.toHexString(c.getClassLoader().hashCode()).equals(code)) {
                result.add(c);
            }
        }
    }
    return result;
}

public static Matcher<String> classNameMatcher(String classPattern, boolean isRegEx) {
    if (StringUtils.isEmpty(classPattern)) {
        classPattern = isRegEx ? ".*" : "*";
    }
    if (!classPattern.contains("$$Lambda")) {
        classPattern = StringUtils.replace(classPattern, "/", ".");
    }
    return isRegEx ? new RegexMatcher(classPattern) : new WildcardMatcher(classPattern);
}

public static Set<Class<?>> searchSubClass(Instrumentation inst, Set<Class<?>> classSet) {
    final Set<Class<?>> matches = new HashSet<Class<?>>();
    for (Class<?> clazz : inst.getAllLoadedClasses()) {
        if (clazz == null) {
            continue;   
        }
        for (Class<?> superClass : classSet) {
            if (superClass.isAssignableFrom(clazz)) {
                matches.add(clazz);
                break;
            }
        }
    }
    return matches;
}

public static Set<Class<?>> searchInnerClass(Instrumentation inst, Class<?> c) {
    final Set<Class<?>> matches = new HashSet<Class<?>>();
    for (Class<?> clazz : inst.getInitiatedClasses(c.getClassLoader())) {
        if (c.getClassLoader() != null && clazz.getClassLoader() != null && c.getClassLoader().equals(clazz.getClassLoader())) {
            if (clazz.getName().startsWith(c.getName())) {
                matches.add(clazz);
            }
        }
    }
    return matches;
}

public static void processClassNames(Collection<Class<?>> classes, int pageSize, PaginationHandler<List<String>> handler) {
    List<String> classNames = new ArrayList<String>(pageSize);
    int segment = 0;
    for (Class aClass : classes) {
        classNames.add(aClass.getName());
        //slice segment
        if(classNames.size() >= pageSize) {
            handler.handle(classNames, segment++);
            classNames = new ArrayList<String>(pageSize);
        }
    }
    //last segment
    if (classNames.size() > 0) {
        handler.handle(classNames, segment++);
    }
}

public static <E> boolean isIn(E e, E... s) {

    if (null != s) {
        for (E es : s) {
            if (isEquals(e, es)) {
                return true;
            }
        }
    }

    return false;

}

public static <E> boolean isEquals(E src, E target) {

    return null == src
            && null == target
            || null != src
            && null != target
            && src.equals(target);

}

public static long[] toPrimitive(final Long[] array) {
    if (array == null) {
        return null;
    } else if (array.length == 0) {
        return EMPTY_LONG_ARRAY;
    }
    final long[] result = new long[array.length];
    for (int i = 0; i < array.length; i++) {
        result[i] = array[i].longValue();
    }
    return result;
}

