    if (nativeAgentProxyDiscoveryFactory == null) {
        synchronized (NativeAgentProxyDiscoveryFactory.class) {
            if (nativeAgentProxyDiscoveryFactory == null) {
                nativeAgentProxyDiscoveryFactory = new NativeAgentProxyDiscoveryFactory();
            }
        }
